import React from 'react';


const Book = ({books, selectBookHandler}) => {

    return(
        <ul>
                {books.map((book, key) => {
                    return <li onClick={selectBookHandler} className="book_list" index={key}> {book} </li>
                })}
            </ul>
    )

}

export default Book;
